  return (
    <div className="App">
      <Layout>
      <Header style={{padding:10}}>
        <Avatar style={{float:'right'}} size="small" src= "images.jpg" />
        <Title style={{color:'white'}} level={3}>Silas Kwabla Gah</Title></Header>
      <Layout>
      <Sider>

      </Sider>
      <Layout>
        <Content>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
      </Layout>
    </Layout>
    </div>
  );
}

export default App;
